*{
    box-sizing: border-box;
}

.bg{
    background-image: url("../img/bgBlur.png");
    width:100%;
    height: auto;
    padding: 1px;
    background-size: cover;
    background-position: center;
}

.container{
    margin: 60px auto;
    height: auto;
    width: 90%;
    display: flex;
    justify-content:space-between;
    /*border:1px red solid;*/
}

.card{
    width: 21%;
    height: 200px;
    padding: 20px 18px;
    position: relative;
    font-family: sans-serif;
    font-weight: 800;
    font-size: 14px;
}
.colorCardFooter{
    opacity: 0.7;
    bottom: 15px;
    position: absolute;
}

.standardBlue{
    background-color: #42A7FF;
    color: white;
}

.boxFrame{
    border: 1px solid #42A7FF;
    color: #42A7FF;
}

.solidPanel{
    background: #1B243B;
    border: 1px solid #42A7FF;
    color: #42A7FF;
}

.selectedArea{
    background: rgba(51,160,255,0.40);
    border: 4px solid #42A7FF;
}

.cardPara{
    margin-left: -16px;
    color: white;
    width: 21%;
    font-family: sans-serif;
    font-size: 12px;
    font-weight: 600;
    line-height: 18px;
    color: rgba(255,255,255,0.9);
    padding-top: 20px;
    /*border: 1px red solid;*/
}

.cardParaTitle{
    font-size: 18px;
}


.mapPanel{
    border: none;
    color: white;
    background: rgba(13,73,126,0.80);
}

.buttonFrame{
    text-align:center;
    border: none;
}

.buttonPrimary{
    display: block;
    background-color: #2E75B3;
    color: white;
    font-size: 14px;
    font-family: sans-serif;
    font-weight: 600;
    border: none;
    width: 94px;
    height: 28px;
    padding-top: 4px;
    transition: .2s;
    margin: 0 auto 24px auto;
}

.buttonPrimary:hover{
    color: white;
    background-color: #42A7FF;
    transition: .2s;
}

.buttonPrimary:active{
    color: white;
    background-color: #2E75B3;
}


.buttonLine{
    display: block;
    color: #42A7FF;
    background-color: transparent;
    font-size: 14px;
    font-family: sans-serif;
    font-weight: 600;
    border: #42A7FF 1px solid;
    width: 94px;
    height: 28px;
    padding-top: 4px;
    transition: .2s;
    margin: 0 auto 0 auto;
}

.buttonLine:hover{
    color: white;
    background-color: #42A7FF;
    transition: .2s;
}

.buttonLine:active{
    color: white;
    background-color: #2E75B3;
}
